import Navbar from "./Header";
import landingPageSection from "./landingSection";

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: "1px solid #DDD"
};

const Layout = props => (
  <div>
    <Navbar />
    <landingPageSection />
    {props.children}
  </div>
);

export default Layout;
